import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.css'
import {Navbar, NavBar, NavbarBrand} from 'react-bootstrap'

function App() {
  return (
    <div className="App">
      <Navbar bg='navbar' variant='dark'>
        <NavbarBrand>
          Logo
        </NavbarBrand>
      </Navbar>
    </div>
  );
}

export default App;
